import axios from "axios";
const KEY = "AIzaSyAMsQ4K6RkQd7BT2m60-w8NuZZsjYPBiag";

export default axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3/search",
  params: {
    part: "snippet",
    maxResult: 5,
    key: KEY,
  },
});
